import gql from "graphql-tag";

const GET_CHANNEL_BY_SLUG = gql`
  query channel ($slug: String) {
    channel (slug: $slug) {
      id
      name
      slug 
      avatar 
      cover 
      description 
      nation 
      language 
      telephone 
      address 
      facebook 
      youtube 
      website 
      official_status 
      follow_value 
      followers{
        user_id
      }
    	created_at
    }
  }
`;

const GET_CHANNELS = gql`
  query channel ($slug: String) {
    channel (slug: $slug) {
      id
      name
      slug 
      avatar 
      cover 
      description 
      nation 
      language 
      telephone 
      address 
      facebook 
      youtube 
      website 
      official_status 
      follow_value 
      followers{
        user_id
      }
    	created_at
    }
  }
`;

const GET_MEMBER_CHANNEL_BY_ID = gql`
  query channelMembers ($id: String!, $page: Int!, $limit: Int! ) {
    channelMembers (id: $id, page: $page, limit: $limit) {
      edges {
        node {
          avatar
          first_name
          last_name
          mobile
          phone
        }
      }
    }
  }
`;

const GET_AD_SELL_LEASE_CHANNEL_BY_ID = gql`
  query channelAdSellLeases ($id: String!, $page: Int!, $limit: Int! ) {
    channelAdSellLeases (id: $id, page: $page, limit: $limit) {
      edges {
        node {
          id
          title
          seo_title
          created_at
          updated_at
          slug
          project
          length
          width
          floor_number
          living_room_number
          view_count
          like_status
          price {
            unit
            value
          }
          avatar {
            alt_text
            src
            description
          }
          address {
            text
            ward
            district
            city
          }
          contact {
            image
            name
            address
            mobile
            phone
            email
          }
          area {
            unit
            value
          }
        }
      }
    }
  }
`;

const GET_RATINGS_CHANNEL_BY_ID = gql`
  query channelAdSellLeaseRatings ($id: String!, $page: Int!, $limit: Int! ) {
    channelAdSellLeaseRatings (id: $id, page: $page, limit: $limit) {
      edges {
        node {
          id
            user_id{
              id
              first_name
              last_name
              avatar
            }
            ad_sell_lease_id {
              id
              title
            }
          rate
          created_at
        }
      }
    }
  }
`;

const GET_AVERAGE_RATING = gql`
  query channelAverageRatings ($id: String!) {
    channelAverageRatings (id: $id) {
      id
      count_rating 
      average_point
      five_star
      four_star
      three_star
      two_star
      one_star
    }
  }
`


export {
  GET_CHANNEL_BY_SLUG,
  GET_CHANNELS,
  GET_MEMBER_CHANNEL_BY_ID,
  GET_AD_SELL_LEASE_CHANNEL_BY_ID,
  GET_RATINGS_CHANNEL_BY_ID,
  GET_AVERAGE_RATING
}
